import './App.css';

function App() {
  return (
    <div className="App">

      <div class="header">
        <button class="login_bt" >Login</button>
        <h4 class="sign_up">Sign up</h4>  
      </div>

      <div class="left_column">

        <h3 class="left_title">Find a rental property</h3>
        <label class="search_area_label">Search area</label> 
        <input class="search_area_input" placeholder="eg. Oxford or NW3"></input>
        <label class="minimum_beds_label">Minimum Beds</label> 
        <input class="minimum_beds_input" placeholder="No min"></input>
        <label class="maximum_beds_label">Minimum Beds</label> 
        <input class="maximum_beds_input" placeholder="No min"></input>

      </div>

      <div class="body">

      </div>

    </div>
  );
}

export default App;
